              "col3": "Where a NIST SP 1500 CDF specification or other interoperable interchange specification does not exist for a particular area of data interchange,  the voting device manufacturer must provide a specification for its native format, describing how the manufacturer has implemented the native format that applies  to the manufacturers specific voting devices and data. This includes such items as descriptions of elements, attributes, constraints, extensions, syntax and semantics of the format, and definitions for data fields and schemas.  \u003c/br\u003e"
